window.bookSummaryJSON = "<p><b>Ages 10+</b></p> <p>Fugitive. Criminal. Robot.</p> <p>A sci-fi adventure for young listeners, <i>Interview with the Robot</i> introduces a unique heroine who seeks the truth about herself.</p> <p>Eve looks like an ordinary 12-year-old girl, but there’s nothing ordinary about her. She has no last name. No parents or guardian. She’s on the run from a dangerous and secretive organization that will stop at nothing to track her down.</p> <p>And most astonishing of all: she’s a robot, a product of Eden Laboratories. When Eve discovers the truth, she realizes everything she thought she knew about herself is a lie. Eve manages to escape, fleeing the lab, the only home she’s ever known.</p> <p>After being arrested for shoplifting, Eve is interviewed by Petra Amis from Child Welfare Services. Her incredible story unfolds during the interrogation, with flashbacks to her life inside Eden Laboratories, which has a dark secret. Listeners follow Eve from her first moment of consciousness to her evolution as a nearly-human companion to Emory, the son of the founder of Eden Laboratories.</p> <p>Exploring a range of topics that drive our society and our lives—topics such as artificial intelligence and human nature - <i>Interview with the Robot</i> is a story told by a startlingly original protagonist, a story that explores the vast potential of technology and the deep complexities of humanity.&nbsp;</p>"; 
